INSERT INTO `gw_modulo` VALUES (1,'Standard','Permite realizar os processos para auxiliar na gestão de compras e estoque, contas a pagar / receber, pagamento de comissões, gerenciamento de propostas, ordens de serviço e vendas, geração de cobranças não registradas (CNR), análise de resultado através de demonstrativo e acesso móvel.',320,NULL,'C','\0'),(2,'Advanced','Permite realizar os processos de cotação de compras, com patamar do fornecedor , através do portal do fornecedor, cobrança registrada, comissão participativa, análise e liberação de propostas, análise de fluxo de caixa, auditoria e gestão de documentos',32,NULL,'C','\0'),(3,'Contratos','Permite auxiliar na gestão de contratos',0,NULL,'C','\0'),(4,'Portal do cliente','Permite uma comunicação mais transparente com o cliente',32,NULL,'C','\0'),(5,'CRM','Permite gerenciar os leads e acompanhar as negociações',32,NULL,'C','\0'),(6,'NFS-e','Permite a emissão e a gestão de NFS-e (Notas fiscais eletrônicas de serviço)',64,NULL,'C','\0'),(7,'NF-e','Permite realizar os processos para emissão e gestão de Notas fiscais eletrônicas (NF-e)',64,NULL,'C','\0'),(8,'Cobrança','Permite auxiliar na gestão de cobranças',32,NULL,'C','\0'),(9,'Frota','Permite auxiliar na gestão da frota',20,NULL,'F','\0'),(10,'Mensageiro','Permite realizar a comunicação entre pessoas, envio de e-mails e mensagens de texto sms',0.08,0.15,'M','\0'),(11,'Escrituração fiscal','Escrituração fiscal',64,NULL,'C','\0'),(12,'Contabilidade','Contabilidade',64,NULL,'C','\0'),(13,'Gráficos e estatísticas','Permite a análise gráfica de determinados processos e resultados',32,NULL,'C','\0'),(14,'SomaSeg','Sistema de monitoramento integrado',300,300,'C','\0'),(15,'Cupom fiscal','Permite a integração com cupom fiscal',NULL,NULL,'C','\0');
